import "./App.css";
import React from 'react'
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import Search from "./Components/Search";
import Home from "./Components/Home";


function App() {


  return (
    <div className="app">
        <Routes>
            <Route path="/" element={<Home/>} />
        </Routes>
    </div>
  );
}

export default App;
